    @BeforeEach
    void setUp() {
        // Create the low-level client
        restClient = RestClient.builder(
                new HttpHost("localhost", 9200)).build();

        // Create the transport with a Jackson mapper
         transport = new RestClientTransport(
                restClient, new JacksonJsonpMapper());

        // And create the API client
        client = new ElasticsearchClient(transport);
    }


    BooleanResponse deleteIndex(String indexName) throws IOException {

        if(client.indices().exists(o -> o.index("characters")).value()) {
            client.indices()
                    .delete(g -> g.index(indexName));
        }

        return client.indices().exists(o -> o.index("characters"));
    }

    BooleanResponse existIndex(String indexName)  throws IOException {
        return client.indices().exists(o -> o.index(indexName));
    }

    @Test
    public void saveOneDocument() throws IOException {

        //given
        // test data
        CharacterDto dto =
                CharacterDto.builder()
                        .id(1L)
                        .character_name("오지환")
                        .world_name("루나")
                        .character_level(250)
                        .build();

        String indexName = "characters";

        //when
        elasticsearchOperations.save(CharacterDocument.dtoToDocument(dto));

        //then
        assertTrue(existIndex("characters").value(), "인덱스 생성 실패");
        assertFalse(deleteIndex("characters").value(), "인덱스 삭제 실패");

    }


